import React, { Component } from "react";

class Counter extends Component {
      render() {
            return (
                  <>
                        <div class="newCountDisplay">
                              <div class="counterWidget"></div>
                              <div class="counterForm"></div>
                        </div>
                  </>
            );
      }
}

export default Counter;
